void tvd_2d_setting(struct TVD_DRV *drv)
{
#if TVD_ADV_SETTING
	void *base = drv->reg.tvd_base;
	const struct reg_val *tmp;
	uint32_t i;
	uint32_t length;

	switch (drv->tvd.mode) {
	case AV_PAL_N:
		tmp = pal_n_reg_value;
		length = ARRAY_SIZE(pal_n_reg_value);
		break;
	case AV_PAL:
		tmp = pal_2d_reg_value;
		length = ARRAY_SIZE(pal_2d_reg_value);
		break;
	case AV_PAL_M:
		tmp = pal_m_reg_value;
		length = ARRAY_SIZE(pal_m_reg_value);
		break;
	case AV_NTSC:
		tmp = ntsc_2d_reg_value;
		length = ARRAY_SIZE(ntsc_2d_reg_value);
		break;
	case AV_SECAM:
		tmp = secam_reg_value;
		length = ARRAY_SIZE(secam_reg_value);
		break;
	case AV_PAL_60:
		tmp = pal_60_reg_value;
		length = ARRAY_SIZE(pal_60_reg_value);
		break;
	case AV_UNSTABLE:
		TVD_LOG_ERR("TVD(2D) mode auto detect: unstable");
		return;
	case AV_NTSC443:
		tmp = ntsc443_reg_value;
		length = ARRAY_SIZE(ntsc443_reg_value);
		break;
	default:
		tmp = pal_2d_reg_value;
		length = ARRAY_SIZE(pal_2d_reg_value);
		break;
	}
	for (i = 0; i < length; i++)
		TVD_WRITE32((unsigned long)base + tmp[i].offset, tmp[i].value);

#else
	TVD_LOG_DBG("null func in %s", __func__);
#endif
}

void tvd_3d_setting(struct TVD_DRV *drv)
{
#if TVD_ADV_SETTING
	void *base = drv->reg.tvd_base;
	const struct reg_val *tmp;
	uint32_t i;
	uint32_t length;

	switch (drv->tvd.mode) {
	case AV_PAL_N:
		tmp = pal_n_reg_value;
		length = ARRAY_SIZE(pal_n_reg_value);
		break;
	case AV_PAL:
		tmp = pal_3d_reg_value;
		length = ARRAY_SIZE(pal_3d_reg_value);
		break;
	case AV_PAL_M:
		tmp = pal_m_reg_value;
		length = ARRAY_SIZE(pal_m_reg_value);
		break;
	case AV_NTSC:
		tmp = ntsc_3d_reg_value;
		length = ARRAY_SIZE(ntsc_3d_reg_value);
		break;
	default:
		tvd_2d_setting(drv);
		length = 0;
		return;
	}

	for (i = 0; i < length; i++)
		TVD_WRITE32((unsigned long)base + tmp[i].offset, tmp[i].value);

#else
	TVD_LOG_DBG("null func in %s", __func__);
#endif
}

